@HelloRentSmart is now tracking rent trends at over 200 buildings in Denver. This was a big achievement for us, but it's really just the start. 

There are more buildings, more insights, and more solutions we can provide.

All of this will be powered by data and people. https://t.co/oPqkUsLojL

@HelloRentSmart's funding proposal is officially up on @oceanpearlio.  

This funding round there are 34 projects seeking a total of $307k in funding, when there is only $100k USD available.

https://t.co/7dopN40bgh
